import Header from './Header'
import Footer from './Footer'
import { Segment, Container } from 'semantic-ui-react'


const Layout = props => {
  return (
    <Container style={{ height: '100vh', margin: '0 auto' }}>
      <Header />
        <Segment>
          {props.children}
        </Segment>
      <Footer />
    </Container>
  )
}

export default Layout
